import React from "react";
import { Container } from "theme-ui";
import { Redirect, Route, Switch } from "react-router-dom";
import { Earn } from "src/pages/Earn";
import { Farm } from "src/pages/Farm";
import { Supply } from "src/pages/Earn/Supply"
import { Header } from "src/components/Header";
import Modal from "react-modal";
import { Footer } from "src/components/Footer";
import { Withdraw } from "src/pages/Earn/Withdraw";
import { RecoilRoot } from 'recoil';


const App: React.FC = () => {
  React.useEffect(() => {
    Modal.setAppElement("body");
  });

  return (
    <Container sx={{ maxWidth: "100%", width: "auto" }}>
      <Container sx={{ py: 6, px: [4, "15%"] }}>
        <Header />
        <Switch>
          <Route exact path="/">
            <Redirect to="/earn" />
          </Route>
          <Route exact path="/earn">
            <Earn />
          </Route>
          <Route exact path="/farm">
            <Farm />
          </Route>
          <Route exact path="/supply/:tokenAddress">
            <Supply />
          </Route>
          <Route exact path="/withdraw/:tokenAddress">
            <Withdraw />
          </Route>
          {/* <Route exact path="/search/:name">
            <SearchDetail />
          </Route>
          <Route exact path="/search/:name/reserve">
            <Reserve />
          </Route>
          <Route exact path="/search/:name/extend">
            <Extend />
          </Route> */}
        </Switch>
      </Container>
      <Footer />
    </Container>
  );
};

export default App;
